import './rankings.css';

export default function Rankings() {
    return (
        <div className = "rankings">
            <h2 className = "most-popular-rank"> &#129351; Most Popular </h2>
            <h3 className = "second-popular-rank"> &#129352; Second </h3>
            <h4 className = "third-popular-rank"> &#129353; Third </h4>
        </div>
    )
}
